INSERT INTO `bc73q_sefurls` VALUES(177, 0, 'reference/stranky/reference-jednotlivci/kilientska-reference-kinisi', 'index.php?option=com_content&catid=76&id=179&view=article', '137', 'Fyzioterapeutické centrum v Horních Počernicích v Praze získává stále více pozitivních hodnocení od svých klientů.', 'zdraví, ale, člověk, atmosféře, hodiny, probíhají, pohodové, prostředí', '', '', NULL, '', NULL, NULL, '', '0000-00-00', 15, NULL, 1, 0, 1, 1, '2017-12-14', 'weekly', '0.5', 0, '', 3);
INSERT INTO `bc73q_sefurls` VALUES(178, 0, 'reference/stranky/reference-jednotlivci/john-anderson-4', 'index.php?option=com_content&catid=76&id=175&view=article', '137', '&nbsp;Jsem velmi spokojená, ráda se vracím. Špičková péče, vysoká odbornost, individuální přístup ke klientovi. Pan fyzioterapeut je velmi ochotný, vstřícný a trpělivý. Zkrátka kvalita v každém směru.', 'velmi, ochotný, fyzioterapeut, pan, klientovi, vstřícný, trpělivý, směru', '', '', NULL, '', NULL, NULL, '', '0000-00-00', 15, NULL, 1, 0, 1, 1, '2017-12-14', 'weekly', '0.5', 0, '', 3);
INSERT INTO `bc73q_sefurls` VALUES(179, 0, 'reference/stranky/reference-jednotlivci/john-anderson-3', 'index.php?option=com_content&catid=76&id=174&view=article', '137', '&nbsp;Vždy naprosto spokojená a po každé terapii vidím značné vysledky. Terapeutka Lenka Augustínová je naprosto skvělá...\r\nJe perfektní fyzioterapeutka, která má profesionální, velice milý a ohleduplný přístup. Krásné prostředí. Jsem nadmíru', 'naprosto, spokojená, profesionální, velice, která, milý, fyzioterapeutka, přístup', '', '', NULL, '', NULL, NULL, '', '0000-00-00', 15, NULL, 1, 0, 1, 1, '2017-12-14', 'weekly', '0.5', 0, '', 3);
INSERT INTO `bc73q_sefurls` VALUES(180, 0, 'reference/stranky/reference-jednotlivci/john-anderson-2', 'index.php?option=com_content&catid=76&id=173&view=article', '137', '&nbsp;Fyzioterapeutka Lenka Augustinová je, díky své teoretické výbavě, praktickým umem a zkušenostmi, odborníkem zřejmě z jiné galaxie :)... mám letité problémy s páteří, ale dosud jsem nepotkala člověka/profesionála jako je ona! Je příkladem toho,', 'své, když, člověk, profese, dává, toho, příkladem, člověka/profesionála', '', '', NULL, '', NULL, NULL, '', '0000-00-00', 15, NULL, 1, 0, 1, 1, '2017-12-14', 'weekly', '0.5', 0, '', 3);
INSERT INTO `bc73q_sefurls` VALUES(181, 0, 'reference/stranky/reference-jednotlivci/john-anderson-5', 'index.php?option=com_content&catid=76&id=178&view=article', '137', '&nbsp;Příjemné prostředí, profesionální a osobní přístup. Určitě se domluvime a vratime.\r\n\r\n&nbsp;', 'domluvime, vratime, \r\n\r\n&nbsp, určitě, přístup, příjemné, prostředí, profesionální', '', '', NULL, '', NULL, NULL, '', '0000-00-00', 15, NULL, 1, 0, 1, 1, '2017-12-14', 'weekly', '0.5', 0, '', 3);
